description:
Html Helpers that provide badges and links to associated Github and Nuget projects.

@Html.NuInstall("package")
@Html.NuPanel("package", @html, ...)
@Html.GhForkme("user/repo", [color], [side])
@Html.GhDownload("user/repo", [font])
@Html.ShBadge(shType.downloads_nuget, ...)
@Html.Code(@html)
